import React from "react";
import { useHistory } from "react-router-dom";
import "../../App.css";
import loginImg from "../../money.svg";
import {Redirect, Link} from "react-router-dom";
import { 
    INDEX_PATH
   } from "../../constants/pageNames";

class AdminPage extends React.Component {
    routeChange = () =>{ 
        const history = useHistory();
        history.push(INDEX_PATH);
      }

    render(){
        return(

            <div className="admin-top-left-container">
                <div className="logo">
                    <img src={loginImg}/>
                </div>
                <div className="admin-top-middle-container">
                    Powered By EduPay
                </div>
                <div className="admin-top-right-container">
                    <button className="btn"  onClick={routeChange}>
                        Logout
                    </button>
                </div>

            </div>

        )
    }

}

export default AdminPage;
